import { Button } from "antd";
import { SlidingDiv,UsersDiv,SocialShareHeading,SocialShareFacebook, AutopostDiv,MaxScoreDiv } from "./Component";
import { useState } from "react";
import { CheckOutlined, CloseOutlined } from '@ant-design/icons';
import { Switch, Space } from 'antd';
// import { Slider } from 'antd';
import { Col, InputNumber, Row, Slider } from 'antd';
const SocialDiv = () => {
    const data = [
        { id: 1, name: 'Item 1', quantity: 5 },
        { id: 2, name: 'Item 2', quantity: 8 },
        { id: 3, name: 'Item 3', quantity: 3 }
      ];
    const userData=[{
        name:"kuberan"
    }]
    // const [SlideStyle,setSlideStyle]=useState("right:-100")
    const [inputValue, setInputValue] = useState(1);
  const onChange = (newValue) => {
    setInputValue(newValue);
  };
    return ( 
        <UsersDiv>
             {userData.map(user => (
          <li key={user.name}> {user.name} <button>change</button> </li>  ))}
            <SlidingDiv>
                <SocialShareHeading>Social Share Setting</SocialShareHeading>
                <SocialShareFacebook>

                    <AutopostDiv>
                        <p>Allow Autopost</p>
                        <Switch checkedChildren={<CheckOutlined />} unCheckedChildren={<CloseOutlined />} defaultChecked/>
                     </AutopostDiv>
                    <MaxScoreDiv>
                        <p>Minimum score to auto-post on social media</p><></>
                        <Col span={12}>
        <Slider
          min={1}
          max={20}
          onChange={onChange}
          value={typeof inputValue === 'number' ? inputValue : 0}
        />
      </Col>
                    </MaxScoreDiv>
                </SocialShareFacebook>
            </SlidingDiv>

        </UsersDiv>
     );
}

export default SocialDiv;
